import React from 'react'

export default function Index() {
  return (
    <div className='footer'>
      <div className="allSide">
        <div className="side1"></div>
        <div className="side2"></div>
        <div className="side1"></div>
        <div className="side1"></div>
      </div>
    </div>
  )
}
